import {Stack} from './Screens'
import Home from "../screens/Home/Home";

export function DesignationManagementStack(props) {
    return (
      <Stack.Navigator
        screenOptions={{
          mode: "card",
          headerShown: "screen",
        }}
        initialRouteName="DesignationManagement"
      >
        <Stack.Screen
          name="DesignationManagement"
          component={Home}
          options={{
            header: ({ navigation, scene }) => (
              <Header
                title="Designation Management"
                navigation={navigation}
                scene={scene}
              />
            ),
            cardStyle: { backgroundColor: "#FFFFFF" },
          }}
        />
      </Stack.Navigator>
    );
  }
